function Unilista(props) {
    
    return (
        <div>
            {
                props.unet.map(uni => {
                    return (
                        <p key={uni.id}>
                            Unen määrä: {uni.maara}<br />
                            Päivämäärä: {uni.pvm}<br />
                            Unen laatu: {uni.laatu}<br />
                            Lisätietoja: {uni.laatu}<br />
                        </p>
                    ) // return
                }) // map
            }
        </div>
    )
}
export default Unilista;
